  position: absolute;
  left: 15px;
  content: " ";
  width: 34px;
  height: 28px;
  background-color: #fafafa;
  border-radius: 0 15px 15px 0;
  transition: transform 0.13s ease-out;
}

.high-speed-track.checked::after {
  transform: scale(0);
}

.submit {
  padding: 10px 0 17px 0;
}

.submit-button {
  background-color: #f90;
  height: 40px;
  line-height: 40px;
  color: #fff;
  border-radius: 6px;
